import MixerHome from './MixerHome'
import {  Link } from "react-router-dom";

const NavBar= () =>{
  return (
    <>
    <MixerHome />
    <ul class="nav justify-content-end">
        <li class="nav-item">
          <a class="nav-link" href="essentials">Essentials</a>
        </li>
        <li class="nav-item">
